import React from 'react'
import { recipeList } from '../Components'

export default function Recipes({ recipeList }) {
    return (
        <div>
            <h1> Recipes Page </h1>
            <ul>
                {recipeList.map(recipe => {
                    <li> {recipe.name} </li>
                })}
            </ul>
        </div>
    )
}
